import UPILogo from "../../assets/images/icons/upi-logo.svg";
import PaytmLogo from "../../assets/images/icons/paytm-logo.svg";
import VisaLog from "../../assets/images/icons/visa-logo.svg";
import MasterCardLogo from "../../assets/images/icons/mastercard-logo.svg";
import AmexLogo from "../../assets/images/icons/amex-logo.svg";
import DinnerClubLogo from "../../assets/images/icons/dinnerclub-logo.svg";

export const paymentMethods = [
  {
    icon: UPILogo,
  },
  {
    icon: PaytmLogo,
  },

  {
    icon: VisaLog,
  },
  {
    icon: MasterCardLogo,
  },
  {
    icon: AmexLogo,
  },
  {
    icon: DinnerClubLogo,
  },
];

export const pricingList = [
  {
    free: null,
    planName: "individual",
  },
  2,
  3,
  4,
];
